// SPDX-License-Identifier: GOG
pragma solidity ^0.8.0;

import "./IERC721.sol";
import "./OperatorRole.sol";
import "@openzeppelin/contracts-upgradeable/utils/cryptography/ECDSAUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract GOGAuction is OperatorRole, PausableUpgradeable {

    using ECDSAUpgradeable for bytes32;

    struct Auction {
        // Parameters of the auction. Times are either
        // absolute unix timestamps (seconds since 1970-01-01)
        // or time periods in seconds.
        uint auctionEnd;

        // Current state of the auction.
        address highestBidder;
        uint highestBid;

        //Minumin Bid Set by the beneficiary
        uint minimumBid;

        // Set to true at the end, disallows any change
        bool ended;

        //Artwork being Auctioned
        uint artwork;

        //Beneficiary
        address payable beneficiary;

        //buynow price
        uint buyNowPrice;

        IERC721 ERC721;

        IERC20 ERC20;

        address ERC721ContractAddress;

        address ERC20ContractAddress;

        bool paused;

    }

    mapping (string => Auction) Auctions;

    address payable public gogWallet;

    // Allowed withdrawals of previous bids
    mapping(address => uint) pendingReturns;

    // Events that will be fired on changes.
    event HighestBidIncreased(string auction, address bidder, uint amount);
    event AuctionEnded(address winner, uint amount);
    event BuyNow(address buyer, uint amount);
    event AuctionCancel(string auction);
    event NewAuctionCreated(string auctionId, uint artwork);
    event DidNotFinishYet(uint time, uint auctionTime);
    event NotTheContractOwner(address owner, address sender);
    event ContractIsPaused(bool paused);
    event ContractIsResumed(bool paused);
    event AuctionToogled(string auctionId, bool paused);

    /// Create a simple auction with `_biddingTime`
    /// seconds bidding time on behalf of the
    /// beneficiary address `_wallet`.
    function initialize (
        address _wallet
    ) public initializer
    {   
        __OperatorRole_init();
        __Pausable_init();

        gogWallet = payable(_wallet);
    }

    /**
     * @dev Triggers smart contract to stopped state
     */
    function pause()
        public
        onlyOperator
    {
        _pause();
        emit ContractIsPaused(true);
    }

    /**
     * @dev Returns smart contract to normal state
     */
    function unpause()
        public
        onlyOperator
    {
        _unpause();
        emit ContractIsResumed(false);
    }

    function createAuction(string memory _id, uint _biddingTime, uint _artwork, uint _minimumPrice, address _erc721ContractAddress, address _erc20ContractAddress) public whenNotPaused onlyOperator {

        IERC721 ERC721 = IERC721(_erc721ContractAddress);
        address _owner = ERC721.ownerOf(_artwork);

        Auction memory auction = Auction({
            auctionEnd: _biddingTime,
            artwork: _artwork,
            beneficiary: payable(_owner),
            highestBidder: address(0),
            highestBid: 0,
            ended: false,
            minimumBid: _minimumPrice,
            buyNowPrice: 1000 ether,
            ERC721: ERC721,
            ERC20: IERC20(_erc20ContractAddress),
            ERC721ContractAddress: _erc721ContractAddress,
            ERC20ContractAddress: _erc20ContractAddress,
            paused: false
        });

        Auctions[_id] = auction;

        emit NewAuctionCreated(_id, _artwork);

    }

    /// Bid on an auction with the value sent
    /// together with this transaction.
    /// The value will only be refunded if the
    /// auction is not won.
    function bid(string memory _auction, uint _amount) public whenNotPaused {

        Auction memory auction = Auctions[_auction];

        require(!auction.paused, "Auction is paused");
        // Revert the call if the bidding
        // period is over.
        require(block.timestamp <= auction.auctionEnd, "This auction has ended");

        // Revert the call value is less than the minimumBid.
        require(_amount >= auction.minimumBid, "The bid value is invalid");

        // If the bid is not higher, send the
        // money back.
        require(_amount > auction.highestBid, "The bid value is invalid");

        if (auction.highestBid != 0) {
            // Sending back the money by simply using
            // highestBidder.send(highestBid) is a security risk
            // because it could execute an untrusted contract.
            // It is always safer to let the recipients
            // withdraw their money themselves.
            pendingReturns[auction.highestBidder] += auction.highestBid;
        }

        require(auction.ERC20.balanceOf(msg.sender) >= _amount, "Not enough funds");

        uint256 allowance = auction.ERC20.allowance(msg.sender, address(this));
        require(allowance == _amount, "Check the Token allowance");

        require(auction.ERC20.transferFrom(msg.sender, address(this), _amount), "The transaction was not approved");

        auction.highestBidder = msg.sender;
        auction.highestBid = _amount;
        Auctions[_auction] = auction;
        emit HighestBidIncreased(_auction, msg.sender, _amount);
    }

    /* function buyNow(string memory _auction, uint _amount) public {

        Auction storage auction = Auctions[_auction];

        require(block.timestamp >= auction.auctionEnd, "Auction still active, can't buy now"); // auction has ended
        require(!auction.ended, "Auction still not finished"); // this function has already been called

        //Require that the value sent is the buyNowPrice Set by the Owner/Benneficary
        require(_amount == auction.buyNowPrice, "The ammount is not corrrect");

        //Require that there are no bids
        require(auction.highestBid == 0, "This auction has bids already");

        require(ERC20.balanceOf(msg.sender) >= _amount, "Not enough funds");

        uint256 allowance = ERC20.allowance(msg.sender, address(this));
        require(allowance == _amount, "Check the Token allowance");

        //Tranfer ERC20
        uint fee = calculateFee(_amount);
        require(ERC20.transferFrom(msg.sender, auction.beneficiary, _amount-fee), "The transaction was not approved");
        require(ERC20.transferFrom(msg.sender, gogWallet, fee), "The transaction was not approved");

        // End Auction
        auction.ended = true;
        auction.highestBid = _amount;
        Auctions[_auction] = auction;
        emit BuyNow(msg.sender, _amount);

        ERC721Gog.safeTransferFrom(auction.beneficiary, msg.sender, auction.artwork);


    } */

    /// Withdraw a bid that was overbid.
    function withdraw(string memory _auction) public whenNotPaused returns (bool) {

        Auction memory auction = Auctions[_auction];

        uint amount = pendingReturns[msg.sender];
        require(amount > 0, "The address has nothing left to withdraw");

        // It is important to set this to zero because the recipient
        // can call this function again as part of the receiving call
        // before `send` returns.
        pendingReturns[msg.sender] = 0;
        auction.ERC20.transfer(msg.sender, amount);

        // No need to call throw here, just reset the amount owing
        pendingReturns[msg.sender] = amount;

        return true;
    }

    function auctionCancel(string memory _auction) public whenNotPaused onlyOperator {

        Auction storage auction = Auctions[_auction];

        require(!auction.paused, "Auction is paused");

        //Auction Ended
        require(block.timestamp >= auction.auctionEnd, "The time still good");

        //has no maxbid 
        require(auction.highestBid == 0, "It has bids, you cannot cancel");

        auction.ended = true;
        Auctions[_auction] = auction;
        emit AuctionCancel(_auction);

    }

    /// End the auction and send the highest bid
    /// to the beneficiary and 10% to GOG.
    function auctionEnd(string memory _auction) public whenNotPaused onlyOperator {

        Auction storage auction = Auctions[_auction];

        require(!auction.paused, "Auction is paused");

        require (block.timestamp >= auction.auctionEnd, "The auction has not ended yet"); // auction has ended
        require(!auction.ended, "The auction has not ended yet"); // this function has already been called

        // End Auction
        auction.ended = true;
        Auctions[_auction] = auction;

        emit AuctionEnded(auction.highestBidder, auction.highestBid);
        if (auction.highestBid != 0) {
            uint fee = calculateFee(auction.highestBid);
            require(auction.ERC20.transferFrom(address(this), auction.beneficiary, auction.highestBid-fee), "The transaction was not approved");
            require(auction.ERC20.transferFrom(address(this), gogWallet, fee), "The transaction was not approved");

            // Send the token
            // If the auction was created by the gallery mint the token otherwise just transfer

            auction.ERC721.safeTransferFrom(auction.beneficiary, auction.highestBidder, auction.artwork);

        }

    }

    function toggleAuction(string memory _auction) public onlyOperator {

        Auction storage auction = Auctions[_auction];

        // End Auction
        auction.paused = !auction.paused;
        Auctions[_auction] = auction;

        emit AuctionToogled(_auction, auction.paused);

    }

    function getAuctionInfo(string memory _auction) public view returns (uint end, address beneficiary, uint maxBid, address maxBidder) {

        Auction storage auction = Auctions[_auction];

        end = auction.auctionEnd;
        beneficiary = auction.beneficiary;
        maxBid = auction.highestBid;
        maxBidder = auction.highestBidder;
    }

    function calculateFee (uint256 _price) internal pure returns(uint) {
        return (_price * 10)/100;
    }

    function canOperate() public view returns(bool) {
        return operators[_msgSender()];
    }
}
